<html lang="en">
  <head>

    <link rel="stylesheet" href="tab_bar.css" />
  </head>

    <div class="tab-bar">
      <div class="ellipse-2">

        <div class="vuesaxlinearcloud">

        <div class="vuesaxlinearsetting">
          <img class="setting" src="../assets/vectors/setting_1_x2.svg" />
